import React from "react";
import { Row, Col } from "antd";
import { useRouter } from "next/router";
import {
	WidthImg,
	centerCol,
	Texty,
	ActionBtn,
} from "../assets/css/style_result";

const Home = () => {
	const router = useRouter();

	const toTest = () => {
		router.push("/test");
	};

	return (
		<>
			<Row
				justify="center"
				style={{ height: "100vh", backgroundColor: "#f66a70" }}
			>
				<Col {...centerCol}>
					<Texty strong top={100} bottom={0} font={20} color={"#fff"}>
						나랑 어울리는 애완동물은?
					</Texty>

					<WidthImg src={require("../assets/images/deoksun.png")} />

					<ActionBtn top={-50} onClick={toTest}>
						<Texty font={15}>러브둥둥 추천 시작!</Texty>
					</ActionBtn>
				</Col>
			</Row>
		</>
	);
};

export default Home;

